import { Column } from 'primereact/column';
import { DataTable } from 'primereact/datatable';
import React from 'react';
import { useTranslation } from 'react-i18next';

export const TableProduct = (props) => {
  const { t } = useTranslation('common');

  return (
    <DataTable {...props} selectionMode="single" dataKey="id" showGridlines>
      <Column field="orderId" header={t('pos.code')}></Column>
      <Column field="itemDescription" header={t('pos.productName')}></Column>
      <Column field="quantity" header={t('pos.quantity')}></Column>
      <Column field="unitAmount" header={t('pos.price')}></Column>
    </DataTable>
  );
};
